import service from './axios_service';

const getAllItems = () => {
    return service.get('/items');
};

const getAllCategoryItems = async category => {
    return await service.get(`/items/${category}`);
};

const getCategoryItem = (category, id) => {
    return service.get(`/items/${category}/${id}`);
};

const getPackages = () => {
    return service.get('/items/paquetes');
};

export default {
  getAllItems,
  getAllCategoryItems,
  getCategoryItem,
  getPackages
};
